239482085 You can try something like [`http-server`](https://www.npmjs.com/package/http-server):

``` bash
npm install -g http-server
```

The only thing is that `browser-sync` is configured to proxy requests to the API, so you'll have to figure that out, i.e. this section in the `gulpfile.js`:

``` js
    /*
     * Location of your backend server
     */
    var proxyTarget = config.api || 'http://localhost:8080';

    var proxy = httpProxy.createProxyServer({
        target: proxyTarget
    });

    proxy.on('error', function(error, req, res) {
        res.writeHead(500, {
            'Content-Type': 'text/plain'
        });

        console.error(chalk.red('[Proxy]'), error);
    });

    /*
     * The proxy middleware is an Express middleware added to BrowserSync to
     * handle backend request and proxy them to your backend.
     */
    function proxyMiddleware(req, res, next) {
        /*
         * Proxy the REST API.
         */
        if (/^\/api\/.*/.test(req.url)) {
            proxy.web(req, res);
        } else {
            next();
        }
    }

    browserSync.init({
        server: {
            baseDir: hygieia.dist,
            startPath: '/',
            middleware: [proxyMiddleware]
        }
    });
```
